import React, { useState } from 'react';
import axios from 'axios';

const GetStudentMarksForm = () => {
  const [studentId, setStudentId] = useState('');
  const [studentMarks, setStudentMarks] = useState([]);

  const handleChange = (event) => {
    setStudentId(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();

    axios
      .get(`http://localhost:8080/getStudentMarks/${studentId}`)
      .then((response) => {
        setStudentMarks(response.data);
      })
      .catch((error) => {
        console.error(error);
      });
  };

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <label>
          Student ID:
          <input type="number" value={studentId} onChange={handleChange} />
        </label>
        <button type="submit">Fetch Student Marks</button>
      </form>

      <ul>
        {/* Display student marks */}
        {studentMarks.map((mark) => (
          <li key={mark.id}>
            {/* Display mark details */}
            <p>Telugu: {mark.telugu}</p>
            <p>Hindi: {mark.hindi}</p>
            <p>English: {mark.english}</p>
            <p>Maths: {mark.maths}</p>
            <p>Science: {mark.science}</p>
            <p>Social: {mark.social}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default GetStudentMarksForm;
